(54, 392, 318, '2015-10-26T17:00:31.440-06:00', 'i'),
(58, 396, 1488, '2016-01-21T19:24:38.532-07:00', '•	If you’re not already there, navigate to ayamel.byu.edu. \r\n\r\n•	Push the “Create an account” button to create an account. (You can connect this to your BYU account later if you wish.\r\n\r\n•	On the Ayamel home screen push the pink lettered “Open courses” button.\r\n\r\n•	Scroll down to the “Okuribito” course.\r\n➢	You’ll be able to see all six videos. \r\n\r\n•	Choose the number of the video that I emailed to you earlier. \r\n\r\n•	Enable the annotations by clicking on the bookmark button in the bottom left of the video viewer.\r\n➢	Make sure you enable the annotation number that corresponds with the video you’re watching.\r\n\r\n•	Enable the captions by clicking the “CC” button next to the bookmark button.\r\n\r\n•	Go ahead and push play. \r\n\r\n•	As you watch you will see a lot of words that are yellow. These are the annotated words. You are required to select every single word that is annotated like this. \r\n\r\n•	Do not highlight these annotated words to bring a definition of those because that would defeat the purpose of this study. But feel free to highlight any other words that you don’t know, or want to know. \r\n\r\n•	Enjoy the movie!! \r\n\r\n•	Thank you again so much for being willing to participate in this research and have a good time.\r\n');
