INSERT INTO `helpPage` (`id`, `title`, `contents`, `category`) VALUES
(1, 'Updating Account Information', '<p>Click on your profile icon at the top of the page, in between the <i><b>Help </b></i>button and search bar.</p><p><img title="Image: http://arclite.byu.edu/helpimages/Help1a.png" src="https://s3.amazonaws.com/ayamel/5f4ff998010e9db3fe9a9b5f6d966c95.png"><br></p><p>A drop-down menu will appear. Select <i><b>Account Settings</b></i>.</p><p><img title="Image: http://arclite.byu.edu/helpimages/Help1b.png" src="https://s3.amazonaws.com/ayamel/b1598048d6763e48acac57074e86de48.png"><br></p><p>Use this page to update your account settings.</p>', 'Content Development for Ayamel:  Account'),
(2, 'Changing Your Password', '<p>Note: You will only be able to change your password if you created your account in Ayamel. If you have a BYU or a Google account you must change your password on their site.<br></p><p>Click on your profile icon at the top of the page, in between the <i><b>Help</b></i> button and search bar.</p><p><img title="Image: http://arclite.byu.edu/helpimages/help2a.png" src="https://s3.amazonaws.com/ayamel/1550ada1df9bb3c0a4757cf9f8a1c24c.png"><br></p><p>A drop-down menu will appear. Select <i><b>Account Settings</b></i>.</p><p><img title="Image: http://arclite.byu.edu/helpimages/help2b.png" src="https://s3.amazonaws.com/ayamel/c890cdfaf4f76fe64f9a21ec39f99a5b.png"><br></p><p>Near the bottom of the "Account Settings" page, you will see the title "Change Password."</p><p><img src="https://s3.amazonaws.com/ayamel/f1d77ef4597d09939d1669baaae668eb.png"><br></p><p>Type your new password into the <i><b>New Password</b></i> box and&nbsp;the <i><b>Repeat New Password</b></i> box.</p><p>Hit the <i><b>Change Password</b></i> button.</p>', 'Content Development for Ayamel:  Account'),
(3, 'Merging Accounts', '<b>NOTE:\r\nYou can only merge two accounts. Trying to merge more than this can result in the loss of one of you accounts. </b><br><br>First, click on your user picture\r\n\r\n<br><img title="Image: http://arclite.byu.edu/helpimages/help3a.png" src="https://s3.amazonaws.com/ayamel/a74bcd49b0fff6aa9b86faab1f487661.png"><br><br>Next, select account settings<br><img title="Image: http://arclite.byu.edu/helpimages/help3b.png" src="https://s3.amazonaws.com/ayamel/e4fad486e411d1834d4ab358ea5322f1.png"><br><br>You will see a section on the right that says, “Merge accounts”\r\n\r\n<br><img title="Image: http://arclite.byu.edu/helpimages/help3c.png" src="https://s3.amazonaws.com/ayamel/99ea8618693e640b43b6fb05c967eaf6.png"><br><br>Select the method under which you have your additional account (<i>Google+&nbsp;</i>or&nbsp;BYU)<br><br>\r\n\r\nFill in the required information.<br><br>After you have done this, you should see a window that says, “Alright, account merged.”\r\n\r\n<br><br>You have now merged your accounts.', 'Content Development for Ayamel:  Account'),
(6, 'Course Directory', 'At the bottom of the front page in small text is a link titled <a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/course" title="Link: http://ayamel.byu.edu/course">Course Directory</a>.<br><img title="Image: http://arclite.byu.edu/helpimages/help6a.png" src="https://s3.amazonaws.com/ayamel/8b6354a76227f429df894ec6fbcfeb45.png"><br><br>Clicking on that link will lead you to a large listing of every single course currently in Ayamel. <br><br>From that screen you can join an <a title="Link: http://ayamel.byu.edu/help/7" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/7">open course or request access from a closed course</a>.<br>', 'Content Development for Ayamel:  Courses'),
(7, 'Joining Courses', 'There are two ways to join courses on Ayamel. Make sure you know which your teacher prefers.<br><br>Navigate to the Course Directory. This is located on the bottom left of the Home Page.&nbsp;<br><img src="https://s3.amazonaws.com/ayamel/0b718af7fa16bbd7dbac54e4b518309f.png" title="Image: http://arclite.byu.edu/helpimages/help7d.png"><br>To join an open course, click on the desired open course and then click <i>Join Course</i>.<br><br>To\r\n join a closed course, click on the course name and write out a reason \r\nyou want to join the course to the instructor. Then click <i>Submit Request</i>.<br><br><img title="Image: http://arclite.byu.edu/helpimages/help7a.png" src="https://s3.amazonaws.com/ayamel/5b78a8d0f6d234a1dc58de6ae1a9ebb9.png"><br><br>You will be sent a notification when the instructor accepts or rejects your request.<br><br>Another method would be for the instructor of the course to personally send you a unique "Join a Course" URL. If you have been given a URL, paste that into your web browser to automatically be added to the course.<br><br><img title="Image: http://arclite.byu.edu/helpimages/help7b.png" src="https://s3.amazonaws.com/ayamel/aca2862b1e9b34023cfbeed31333542c.png"><br>', 'Learning with Ayamel:  Courses'),
(8, 'Making Announcements', 'If you are the instructor of the course, or you have been given permission from the instructor, you may make course announcements.<br><br>On the main page of the course on right side is a <i>Make an Announcement</i> button.<br><br><img title="Image: http://arclite.byu.edu/helpimages/help8a.png" src="https://s3.amazonaws.com/ayamel/8e29ef773f5b8dffe473f3bac44ced15.png"><br><br>Type in your announcement and then select <i>Publish</i>.<br><img title="Image: http://arclite.byu.edu/helpimages/help8b.png" src="https://s3.amazonaws.com/ayamel/69ce3a86cbe1a97bb7fccc773a9c6c92.png"><br>', 'Content Development for Ayamel:  Courses'),
(11, 'Accessing Content', '<p>There are several ways to browse content on Ayamel.</p><p>The first is to select My Content on the navigation bar at the top of the page. This will bring you to a page on which will appear&nbsp;all of the content you have uploaded.&nbsp;</p><p><img src="https://s3.amazonaws.com/ayamel/874040caa5bcc64500bb6997420f99f6.png" title="Image: http://arclite.byu.edu/helpimages/help11a.png"><br></p><p>The next way is to&nbsp;Access Ayamel''s homepage by clicking the Ayamel logo or by selection Home on the navigation bar. Content will appear under "Course Content Feed" in the middle of the page. This will show you the most recent&nbsp;content that is included in the courses you belong to.&nbsp;</p><p><img src="https://s3.amazonaws.com/ayamel/f5adf94246640c7d6a3477c8e2435bc7.png" title="Image: http://arclite.byu.edu/helpimages/help11b.png"><br></p><p>The third way is to&nbsp;Access Ayamel''s homepage by clicking the Ayamel logo or by selection&nbsp;Home&nbsp;on the navigation bar. Content will appear under "My Courses" in the middle of the page. This will show you the courses you belong to. Once you click on the course, it will bring you to your course page where you will have access to course content.<br></p><p><img src="https://s3.amazonaws.com/ayamel/6e8f9edec5debb335d907d00974d70cc.png" title="Image: help11c.png"><br><!--</p>--></p>', 'Learning with Ayamel:  Content Viewing'),
(12, 'Viewing Content', '<p>Once you''ve selected a video, the Ayamel video player will appear. (Don''t know how to access content? Click <a href="http://ayamel.byu.edu/help/11" target="_blank" rel="nofollow" title="Link: http://ayamel.byu.edu/help/11">here</a>.)</p><p>To play the video, press&nbsp;<i><b>Play&nbsp;</b></i><b></b>(this is the small triangle-shaped button in the bottom left corner of the video player).&nbsp;</p><p><img src="https://s3.amazonaws.com/ayamel/fac60e52a95aa7db0325af9007ef9b7d.png"><br></p>', 'Learning with Ayamel:  Content Viewing'),
(13, 'Viewing Captions and Transcripts', '<p>Once you''ve opened a video, you can access caption options by clicking the small&nbsp;<i><b>CC&nbsp;</b></i>button to the right of the volume control.</p><p><img src="https://s3.amazonaws.com/ayamel/6765139f4d9a80680a17f8405e4ee4b5.png" title="Image: http://arclite.byu.edu/helpimages/help13a.png"><br></p><p>The menu that appears will allow you to select either foreign-language captions or English captions, depending on what has been provided for the video.</p><p>Remember that you can play two sets of subtitles at once (for example - English and French).</p><p>To view a transcript of the entire film, look to the right of the video player and use the drop-down menu to select a provided transcript.</p><p><img src="https://s3.amazonaws.com/ayamel/bd033c8279a2eb9e65e255718572f1ae.png"><br></p><p>The transcript will scroll along with the video as you watch, and you can use it to visit different scenes by clicking on a line of text.</p><p>For additional help, refer to&nbsp;<i><b>Learn the Basics of Ayamel&nbsp;</b></i><a href="http://ayamel.byu.edu/help/52" target="_blank" rel="nofollow" title="Link: http://ayamel.byu.edu/help/52">here</a>.</p><p><br></p><p></p>', 'Learning with Ayamel:  Content Viewing'),
(14, 'How to translate a word/phrase via the subtitles (Video)', '<iframe src="https://www.youtube.com/embed/8jQcJZUbsSQ" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Learning with Ayamel:  Content Viewing'),
(15, 'Viewing Annotations', '<p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;">You need to turn on the annotation track. To do this, select the flag\r\nbutton next to the CC (closed captioning) button on the video player. Next select\r\nthe annotation track you would like to turn on (it should turn pink once selected).</span><br></p><p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;"><img src="https://s3.amazonaws.com/ayamel/796996d7baf3452d040c75489e941052.png" title="Image: http://arclite.byu.edu/helpimages/help15a.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Now, make sure the captions\r\n(CC) are turned on. This button is located on the player next to the volume\r\nadjustment on the video player. Next select the caption track you would like to turn on (it should turn pink once selected).<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/1661b6ed0052687adf7399170b6bbfe8.png" title="Image: http://arclite.byu.edu/helpimages/help15b.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Next, play the video. When\r\nyou come to an annotated word, it should appear in yellow. <o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/566634b59b83e0d4f5f2aa64759517b1.png" title="Image: http://arclite.byu.edu/helpimages/help15c.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Click on the annotated word\r\nand the annotation will show up to the right of the player under the\r\nAnnotations tab.</span></p><img src="https://s3.amazonaws.com/ayamel/24dd77e566d44fc10deede4859659456.png" title="Image: http://arclite.byu.edu/helpimages/help15d.png"><br>Note: &nbsp;Annotations can be text, image, video, or sound files.&nbsp;', 'Learning with Ayamel:  Content Viewing'),
(16, 'Sharing Content', 'If the content owner has <a title="Link: http://ayamel.byu.edu/help/27" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/27">enabled sharing</a>, a Share button will appear at the top left of every piece of content.<br><img src="https://s3.amazonaws.com/ayamel/f4c826347e3e7435b314a25d79fa675a.png" title="Image: http://arclite.byu.edu/helpimages/help16a.png"><br>Even if the content is private or tightly restricted, sharing gives anyone you share it with access to the content.<br><br><img src="https://s3.amazonaws.com/ayamel/d5adf53f4f6e5135e1b7a83272693ecd.png" title="Image: http://arclite.byu.edu/helpimages/help16b.png"><br><u>Share on Google+</u> will allow you to share the video on Google plus.<br><u>Tweet</u> will allow you to make a Tweet on Twitter that links to the Ayamel video.<br><u>Pin It</u> shares image content to Pinterest. No other type of content can be shared to Pinterest.<br>For developers, copying the <u>Embed Code</u> will allow you to embed the video onto a separate website that you created.<br>A <u>URL</u> will give a unique URL that you may give to anyone give access to the content.<br>', 'Learning with Ayamel:  Content Viewing'),
(22, 'Adding a Brightcove Video (Video)', '<iframe src="https://www.youtube.com/embed/j5nLpe4YTPk" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Content Creation'),
(24, 'Content Configuration', 'If you are the owner of video content, you may edit the settings to allow for a different experience.<br><br>On a video page, select <i>Configuration</i>.<br><img src="https://s3.amazonaws.com/ayamel/bdfa5d62dc322dbfb9f2e133304e7145.png" title="Image: http://arclite.byu.edu/helpimages/help24a.png"><br>Here will be a series of check boxes that will change how Ayamel behaves. In order for any change to take place you must select <i>Save</i> at the bottom.<br><img src="https://s3.amazonaws.com/ayamel/418eca8b7db97d9d63cf1baad5bc8561.png" title="Image: http://arclite.byu.edu/helpimages/help24b.png"><br><br><a title="Link: http://ayamel.byu.edu/help/14" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/14">Allow Automatic Definitions</a> allows users to highlight the subtitles and select portions to be translated.<br><a title="Link: http://ayamel.byu.edu/help/56" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/56">Show Transcripts</a> will show the subtitles of the video on the right in addition to viewing them on the video player.<br><a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/13" title="Link: http://ayamel.byu.edu/help/13">Show Captions</a> will toggle the "CC" button on the video player, allowing you not to have subtitles on your video if you don''t want them.<br><u>Enabled Caption Tracks </u>lists all subtitle tracks that have been made for the video. You may select which ones other users are allowed to view by checking them.<br><a title="Link: http://ayamel.byu.edu/help/15" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/15">Show Text Annotations</a> allows any created annotation tracks to also play with the video.<br><u>Enabled Annotations</u> lists all annotation tracks that have been created. You can select which ones you can allow a user to toggle on or off here.<br><br><img src="https://s3.amazonaws.com/ayamel/43b9dc85d2e7a9ea14800122cd25e95e.png" title="Image: http://arclite.byu.edu/helpimages/help24c.png"><br><a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/28" title="Link: http://ayamel.byu.edu/help/28">Visibility</a> restricts who is able to see this content.<br><span class="control-label"><a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/27">Shareability</a> restricts who is able to share this content.<br><br>Be absolutely sure to press <i>Save</i> at the bottom</span> once you have changed the settings.<br>', 'Content Development for Ayamel:  Content Creation'),
(25, 'Updating Metadata', 'Changing the title and most other aspects of the video can be changed by updating the metadata.<br><br>On a piece of content that you are the owner of, click on <i>Edit</i> and then <i>Edit Metadata</i>.<br><img src="https://s3.amazonaws.com/ayamel/ba94663cc4f5beaa46c9757b738444d2.png" title="Image: https://s3.amazonaws.com/ayamel/ba94663cc4f5beaa46c9757b738444d2.png"><br>On this screen you may edit the title, the description, the language the content is set in, and the category.<br>You may also add specific labels by typing in a word or phrase and pressing<i> add</i> for each label.<br>Be sure to press <i>Save</i> once done.<br><img src="https://s3.amazonaws.com/ayamel/02e832b9174f1787bf3153dc584042a6.png"><br>Most settings not changeable on this page will fall under <a title="Link: http://ayamel.byu.edu/help/24" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/24">Edit Configuration</a>.<br>', 'Content Development for Ayamel:  Content Creation'),
(27, 'Setting the Shareability', 'Sharing enables a user to share the content in a variety of ways which are explained <a title="Link: http://ayamel.byu.edu/help/16" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/16">here</a>.<br><br>On any piece of content that you own, you may restrict who is allowed to share the content by going to the <i>Configuration</i> tab.<br><img src="https://s3.amazonaws.com/ayamel/172653fe9137a34470dbc6f036c37367.png" title="Image: http://arclite.byu.edu/helpimages/help27a.png"><br>Scroll to the bottom and find the&nbsp;<i></i>"Sharebility" section.<br><img src="https://s3.amazonaws.com/ayamel/79a6f0eb7a389a6055da1fe195f9441f.png" title="Image: http://arclite.byu.edu/helpimages/help27b.png"><br><u>Not Shareable</u> doesn''t allow anyone to share the content.<br><u>Shareable by me only</u> will restrict sharing access to you only.<br><label><u>Shareable by anybody</u></label> will allow anyone that has access to the video to also be able to share it.<br><br>Be sure to press <i>Save</i> once you are done with your changes.<br>', 'Content Development for Ayamel:  Content Creation'),
(28, 'Setting the Visibility', 'On any piece of content that you own, you may restrict who is allowed to see the content by going to the <i>Configuration</i> tab.<br><img src="https://s3.amazonaws.com/ayamel/172653fe9137a34470dbc6f036c37367.png" title="Image: http://arclite.byu.edu/helpimages/help27a.png"><br>Next, scroll down to the "Visibility" section of the page.<br><img src="https://s3.amazonaws.com/ayamel/7f216fa97dab0894ad5055b62fd97393.png" title="Image: http://arclite.byu.edu/helpimages/help28b.png"><br><u>Private</u> will leave you as the sole user that can view the content.<br><u>Tightly Restricted</u> will only allow you and the courses you may add it to to see this.<br><u>Loosely Restricted</u> is the same as Tightly Restricted except that all other users <a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/38" title="Link: http://ayamel.byu.edu/help/38">that are instructors</a> can see this content.<br><u>Public</u> will add your content to the latest public content list. Anyone can see it.<br><br>Once you have selected the visibility, press <i>Save</i>.<br>', 'Content Development for Ayamel:  Content Creation'),
(29, 'Deleting Content', '<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">First, click on the\r\nMy Content tab in the upper middle right of the screen.<o:p></o:p></span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/3e6ae951a5b03287fc993f2393898191.png" title="Image: http://arclite.byu.edu/helpimages/help53a.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Next, hit the blue <i>Manage Content</i> button. <o:p></o:p></span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/f2950dd0918e1cdb80100634f13e8b49.png" title="Image: http://arclite.byu.edu/helpimages/help29b.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Now select the gray\r\n<i>View</i> button found on the right side\r\nof the screen for the movie you would like to delete.<o:p></o:p></span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/490b8ec56805bab61e5b55a78dd33498.png" title="Image: http://arclite.byu.edu/helpimages/help29c.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Then, click on the\r\nEdit icon on the top middle of the page.<o:p></o:p></span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/5f96aad96f6767f2fd95cc61d62b2bd7.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Now hit delete.\r\nWhen the window pops up that asks, “Are you sure you want to delete (name of\r\ncontent)?” click on the pink <i>Yes</i>\r\nbutton.<o:p></o:p></span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/337aea570b4c2206cbdce9ec712de3bf.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">You should see a\r\nnotifications that says, “Alright. Content deleted”.&nbsp;</span></p><p class="MsoNormal" style="line-height:normal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">You have successfully\r\ndeleted your content.&nbsp;<o:p></o:p></span></p>', 'Content Development for Ayamel:  Content Creation'),
(31, 'Uploading Captions (Text)', 'To add subtitles on video content, go to <i>Text</i> --&gt; <i>Captions and Subtitles</i>.<br><img src="https://s3.amazonaws.com/ayamel/516eddfd7575dc048428794571619e5c.png" title="Image: http://arclite.byu.edu/helpimages/help31a.png"><br>Press <i>Choose File</i> to select the file. You can upload .SRT, .VTT, .TTML, or .SSA subtitles.<br><img src="https://s3.amazonaws.com/ayamel/7f4e5ad20f02df41f7fc1fb1ae03d76e.png" title="Image: http://arclite.byu.edu/helpimages/help31b.png"><br><br>Give the subtitles a name such as the language of the track.<br><br>Select the language of the track.<br><br>And then press <i>Upload</i>.<br><img src="https://s3.amazonaws.com/ayamel/cad1ad5d705600160b58c991be02a663.png" title="Image: http://arclite.byu.edu/helpimages/help31c.png"><br>', 'Content Development for Ayamel:  Captions'),
(32, 'Creating New Annotations (Video)', '<iframe src="https://www.youtube.com/embed/dhCC6Pq53_o" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Annotations'),
(33, 'Editing Existing Annotations (Text)', '<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">To edit an annotation, click\r\non the text icon and select annotations. <o:p></o:p></span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/c74709fdb4f213a0ca1503bdd2276325.png" title="Image: http://arclite.byu.edu/helpimages/help33a.png" style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Next, select the yellow <i>Launch Annotation Editor</i> button.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/4dce9d7b411fa5120a04bbfc10cf783c.png" title="Image: http://arclite.byu.edu/helpimages/help33b.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">You will then see a window\r\npop up with some auto-filled information. Y</span><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">ou can edit the information if you''d like or s</span><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;">imply hit close</span><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;">.&nbsp;</span></p><p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;"><img src="https://s3.amazonaws.com/ayamel/0726597407191cc86079a1616a83b246.png" title="Image: http://arclite.byu.edu/helpimages/help33c.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Next, select the Edit icon\r\nin the upper middle right.&nbsp;<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/907a05453f18b1ce57a34c63bd06eba8.png" title="Image: http://arclite.byu.edu/helpimages/help33d.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">You will see a list of the annotation tracks you have made. Click on the yellow&nbsp;</span><i style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">Edit&nbsp;</i><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">button of the track on which you would like to make changes.</span></p><p class="MsoNormal"><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;"><img src="https://s3.amazonaws.com/ayamel/8d57ebbaa4d688e3a0e94cdeee10b54a.png" title="Image: http://arclite.byu.edu/helpimages/help33e.png"><br></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">You should now see the words\r\nyou have annotated appear in pink. If you do not, hit the refresh button in the\r\nupper left next to the name of the subtitle track.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">If you would like to delete\r\nan annotation, click on the pink word. Then, select the pink <i>trash</i> button in the lower left corner of\r\nthe pop-up window.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/7d36224eb5f0c500a46b2398de4c228d.png" title="Image: http://arclite.byu.edu/helpimages/help33f.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">To make any other edit to a\r\npreviously made annotation, select the pink word you would like to edit, make\r\nthe change, and then hit the blue <i>save </i>button\r\nin the lower right corner.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/af15bc43fdfc55e60bca76051fd5c522.png" title="Image: http://arclite.byu.edu/helpimages/help33g.png"><br></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Once\r\nyou have made all the changes you would like to make, make sure to save. Hit\r\nthe save icon found in the upper middle of the screen.&nbsp;</span></p><p class="MsoNormal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/c7f879a960a0495a4b9a4ad68a3c66b4.png"><br></span></p><p class="MsoNormal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Select the annotation\r\ntrack you would like to save on, and then click on the pink <i>Save</i> button in the lower right hand of\r\nthe pop-up window.&nbsp;</span></p><p class="MsoNormal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/068a24bdf8bc794a0f6245563c3a9e7d.png" title="Image: http://arclite.byu.edu/helpimages/help33h.png"><br></span></p><p class="MsoNormal"><span style="font-size:12.0pt;\r\nmso-bidi-font-size:11.0pt;line-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">You should see a window that says, “Annotations saved”.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">It is now safe to exit the\r\nannotation editor. Hit the Quit icon in the upper right corner.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">Your changes can now be seen when you turn on the annotations and captions.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;">&nbsp;&nbsp;&nbsp;<o:p></o:p></span></p>', 'Content Development for Ayamel:  Annotations'),
(34, 'How to use CaptionAider (Text)', 'CaptionAider is the name for Ayamel’s web application to add subtitles to videos.\r\n\r\n<br><br>On a video, open up CaptionAider by clicking on <i>Text</i> <i>--&gt; Captions/Subtitles</i> --&gt; <i>Launch CaptionAider.\r\n\r\n</i><br><br>First, create a new track by clicking on the page icon. <br><img src="https://s3.amazonaws.com/ayamel/f24894ddd379a3eff8592bb5fecbd026.png" title="Image: http://arclite.byu.edu/helpimages/help34a.png"><br><br>Type in the name of the track, select the language and click <i>Create</i>.\r\n<br><img src="https://s3.amazonaws.com/ayamel/9af62713afc61ef185b208ef180b0ef7.png" title="Image: http://arclite.byu.edu/helpimages/help34c.png"><br><br><br>Individual captions or subtitles are called “cues” in CaptionAider. To add a cue, click on the plus button (or ‘A’). Select a spot in the track and drag it to the point where the line of dialogue stops.\r\n\r\n<br><img src="https://s3.amazonaws.com/ayamel/d62efeb23e125087f7505d07ac0d90fc.png" title="Image: http://arclite.byu.edu/helpimages/help34d.png"><br><br><br>To add text to the cue, navigate to the spot in the video where the dialogue takes place (make sure the captions are turned on). This can be done by clicking above the subtitle track in the editor timeline, called the “key”. Notice a yellow cursor over the editor indicates the current time in the video. You can then click on the subtitle lines directly on the video player and type in the text.\r\n\r\n<br><img src="https://s3.amazonaws.com/ayamel/34b44327411ee83913a4fee189bbe577.png" title="Image: http://arclite.byu.edu/helpimages/help34e.png"><br><br>To move the cue to fit the dialogue better, select the move tool (or ‘m''). Clicking near the middle of the cue will let you shift the whole cue back and forth, while clicking near the edges will let you drag one edge and change the cue’s size. Notice that the subtitle on the video screen will appear and disappear as you move the cue over or off of the current time marker.\r\n\r\n<br><img src="https://s3.amazonaws.com/ayamel/a1ae52498bec3ff39a1a14b556ce54ad.png" title="Image: http://arclite.byu.edu/helpimages/help34f.png"><br><br><br>To break up a large cue into several smaller ones, use the split tool (or ‘q’).\r\nThis creates two cues containing the same text as the original single cue, separated at the time where you clicked to split. You can then edit the text of the new cues separately so each one has only a part of the original.\r\n\r\n<br><img src="https://s3.amazonaws.com/ayamel/6c9991adac94ecc539466560d970a079.png" title="Image: http://arclite.byu.edu/helpimages/help34g.png"><br><br><br>At any time you can use the undo or redo buttons to undo or redo an action.\r\nOr you can right click, navigate to Editing, undo.<br><img src="https://s3.amazonaws.com/ayamel/bfbec21bf4ff2695fbda3ba6cd7a075f.png"><br><br><br>When you are done editing your video, save your subtitles by clicking the floppy disk icon. <br><img src="https://s3.amazonaws.com/ayamel/b4d06aa9cd818508cbc97487e84038c5.png" title="Image: http://arclite.byu.edu/helpimages/help34i.png"><br><br><br>To save the subtitles on the web for future use, go to the far right and change the <i>Location</i>. Select the track to save, and then select the destination to be <i>Server</i>. <br><img src="https://s3.amazonaws.com/ayamel/abcaf60dcd1b02814ab073d38b640455.png"><br><br><br>To save the tracks for offline use, select server and then choose&nbsp;<i>Save to Disk</i>. We highly recommend saving to disk frequently (at least every thirty minutes or so) that your work will always be backed up.<br><img title="Image: http://arclite.byu.edu/helpimages/help34k.png" src="https://s3.amazonaws.com/ayamel/cecd09c4d7b2df30e871892fc12f0da5.png"><br>Once saved, go back to your video and make sure subtitles are enabled in the <a rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/43" title="Link: http://ayamel.byu.edu/help/43">content configuration</a>. Now anyone can view the subtitles you have added to a video.', 'Content Development for Ayamel:  Captions'),
(35, 'Viewing Content Statistics', 'If you are the owner of the content you may look up statistics about the video.<br><br>Click on <i>Edit </i>and then on <i>View Stats</i>.<br><img src="https://s3.amazonaws.com/ayamel/df9e15d80e0dd712d42fe63780255662.png" title="Image: http://arclite.byu.edu/helpimages/help35a.png"><br>Here you can see how much the video was viewed, what Annotations were viewed and how often they were clicked on.<br><br>You can also download these statistics and open them as an Excel Spreadsheet.<br><br>You can always reset all of these statistics by clicking <i>Clear</i>.<br>', 'Content Development for Ayamel:  Content Viewing'),
(38, 'Becoming a Teacher', 'To become a teacher you must first request permission.<br><br>Click on your user picture in the top right corner and go to Account Settings.<br><img title="Image: http://arclite.byu.edu/helpimages/help38b.png" src="https://s3.amazonaws.com/ayamel/a5be646b12ce24c9960f748fb786b093.png"><br>Under permissions, click on "Request Additional Permissions."<br><img src="https://s3.amazonaws.com/ayamel/f4ad6a9234d63ddea180fa320b955d28.png" title="Image: http://arclite.byu.edu/helpimages/help38c.png"><br>Type in your name and email if it is not already auto-filled for you, and from the drop down menu select "Create Course."<br>Type in a reason for why you are requesting permission and then click "Submit Request."<br><img src="https://s3.amazonaws.com/ayamel/b3691d9fdde1bf1147186606c18a77cb.png"><br>An Ayamel administrator will look at your request and grant you the ability to create a course.<br>', 'Content Development for Ayamel:  Courses'),
(39, 'Creating a Course', '<a title="Link: http://ayamel.byu.edu/help/38" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/38">After requesting permission</a>, you will be notified when you can create courses.<br><br>To create a course, on the home page on the right there is a section called <i>My Courses</i>.<br>It will list all courses that you are a part of and at the bottom will be a button called "Create a New Course."<br><img src="https://s3.amazonaws.com/ayamel/63759f9241a8def1439c6d01db535b78.png" title="Image: http://arclite.byu.edu/helpimages/help39a.png"><br>Name your course and set the kind of enrollment. You will probably want to leave it closed for now, you can always change it to "open" later.<br><img src="https://s3.amazonaws.com/ayamel/1bd9cbd2c5c432b05897fba5f39af22b.png" title="Image: http://arclite.byu.edu/helpimages/help39b.png"><br>', 'Content Development for Ayamel:  Courses'),
(40, 'Adding Content to a Course', 'Once you <a title="Link: http://ayamel.byu.edu/help/38" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/38">become a teacher</a> and <a title="Link: http://ayamel.byu.edu/help/39" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/39">create a course</a>, a new button <i>"Add to Course"&nbsp;</i>shows up on every piece of content you see.<br><img src="https://s3.amazonaws.com/ayamel/1bd9cbd2c5c432b05897fba5f39af22b.png" title="Image: http://arclite.byu.edu/helpimages/help40a.png"><br><br>Click this and then select which course you would like to add the content to.&nbsp;<br>Next, push add and the content will be added to the selected course.<br><img src="https://s3.amazonaws.com/ayamel/fc313693bfeeddf01d225261ed1bae31.png" title="Image: http://arclite.byu.edu/helpimages/help60b.png"><br>', 'Content Development for Ayamel:  Courses'),
(41, 'Adding a Course to a LMS (Video)', '<iframe src="https://www.youtube.com/embed/YaCaYIaEfuQ?start=104" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Courses'),
(43, 'Setting Course Captions and Annotations', 'On a video object that you own, select <i>Configuration</i>.<br><img src="https://s3.amazonaws.com/ayamel/98f56307e6d6d9eef1253c052d683434.png" title="Image: http://arclite.byu.edu/helpimages/help43a.png"><br>Then select the things you want enabled on this video.<br><img src="https://s3.amazonaws.com/ayamel/7066bc0a910e1ed5eec71ede91c57ed9.png" title="Image: http://arclite.byu.edu/helpimages/help43b.png"><br><a title="Link: http://ayamel.byu.edu/help/13" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/13">Show Captions</a> will toggle the "CC" button on the video player, allowing you not to have subtitles on your video if you don''t want them.<br><u>Enabled Caption Tracks </u>lists\r\n all subtitle tracks that have been made for the video. You may select \r\nwhich ones other users are allowed to view by checking them.<br><a title="Link: http://ayamel.byu.edu/help/15" rel="nofollow" target="_blank" href="http://ayamel.byu.edu/help/15">Show Text Annotations</a> will toggle the annotation button on the video player, allowing any created annotation tracks to also play with the video.<br><u>Enabled Annotations</u> lists all annotation tracks that have been created. You can select which ones you can allow a user to toggle on or off here.<br><br>Be sure to press <i>Save</i>&nbsp;(located at the bottom of the window)&nbsp;once you have made your changes.<br><img src="https://s3.amazonaws.com/ayamel/72b2a020df93b9d494c8a15e932b79ae.png" title="Image: http://arclite.byu.edu/helpimages/help43c.png"><br><br>', 'Content Development for Ayamel:  Content Creation'),
(48, 'How to Change the Thumbnail', '<p class="MsoNormal">&nbsp;So you want to make your content thumbnail a little more\r\nexciting than this thumbnail?<o:p></o:p></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/66a33db105c79b679b5819baeaab1926.png" title="Image: thumbnail 1.png"><br></p>\r\n\r\n<p class="MsoNormal"><!--[if gte vml 1]><v:shapetype\r\n id="_x0000_t75" coordsize="21600,21600" o:spt="75" o:preferrelative="t"\r\n path="m@4@5l@4@11@9@11@9@5xe" filled="f" stroked="f">\r\n <v:stroke joinstyle="miter"/>\r\n <v:formulas>\r\n  <v:f eqn="if lineDrawn pixelLineWidth 0"/>\r\n  <v:f eqn="sum @0 1 0"/>\r\n  <v:f eqn="sum 0 0 @1"/>\r\n  <v:f eqn="prod @2 1 2"/>\r\n  <v:f eqn="prod @3 21600 pixelWidth"/>\r\n  <v:f eqn="prod @3 21600 pixelHeight"/>\r\n  <v:f eqn="sum @0 0 1"/>\r\n  <v:f eqn="prod @6 1 2"/>\r\n  <v:f eqn="prod @7 21600 pixelWidth"/>\r\n  <v:f eqn="sum @8 21600 0"/>\r\n  <v:f eqn="prod @7 21600 pixelHeight"/>\r\n  <v:f eqn="sum @10 21600 0"/>\r\n </v:formulas>\r\n <v:path o:extrusionok="f" gradientshapeok="t" o:connecttype="rect"/>\r\n <o:lock v:ext="edit" aspectratio="t"/>\r\n</v:shapetype><v:shape id="Picture_x0020_1" o:spid="_x0000_i1026" type="#_x0000_t75"\r\n style=''width:209.25pt;height:81.75pt;visibility:visible;mso-wrap-style:square''>\r\n <v:imagedata src="file:///C:\\Users\\shari\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png"\r\n  o:title="boring"/>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><o:p></o:p></p>\r\n\r\n<p class="MsoNormal">Well you can! Here are instructions about how to do so:<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->1.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->First off, make sure you have already uploaded\r\nthe desired content onto Ayamel. <o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->2.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Click on my content (located in the upper right\r\nhand side of the home page screen).<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->3.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Select the video for which you would like to\r\nchange the thumbnail.<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->4.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->After the video has opened, click on the edit\r\nbutton located in the upper, middle right\r\nhand corner. <o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->5.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Select set thumbnail.<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->6.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Now you have to choose from three options:<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:1.0in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level2 lfo1"><!--[if !supportLists]-->a.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Choose file:&nbsp;\r\nAllows you to upload something saved to your computer’s disk.<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:1.0in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level2 lfo1"><!--[if !supportLists]-->b.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Load from URL:&nbsp;\r\nAllows you to load a link from an image on the internet.&nbsp; Just find the image you want online and copy\r\nthe image link/ location.<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left:1.0in;mso-add-space:\r\nauto;text-indent:-.25in;mso-list:l0 level2 lfo1"><!--[if !supportLists]-->c.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Use the current location of the video as the\r\nthumbnail:&nbsp; Allows you to use whatever\r\nimage the video is at when you choose this option. Just click on the yellow\r\nbutton that says:&nbsp; Make Thumbnail.&nbsp; This does, however, not work for videos\r\nlinked from raw material (content you’ve uploaded via a url; such as a YouTube\r\nvideo). <o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->7.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->Press save <o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><!--[if !supportLists]-->8.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->You will see a note that says, “Heads up.&nbsp; Thumbnail changed.<o:p></o:p></p>\r\n\r\n<p class="MsoListParagraphCxSpLast" style="margin-left:1.0in;mso-add-space:auto;\r\ntext-indent:-.25in;mso-list:l0 level2 lfo1"><!--[if !supportLists]-->a.<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><!--[endif]-->This means you have saved correctly, and your\r\nthumbnail has been changed!<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">Your content should now have a thumbnail displays the image\r\nyou decided to use.&nbsp; Like this one:<o:p></o:p></p>\r\n\r\n<img src="https://s3.amazonaws.com/ayamel/cc1635ef0321a5045097f2556ec0a832.png" title="Image: http://arclite.byu.edu/helpimages/Thumbnail%202.png"><br>', 'Content Development for Ayamel:  Content Creation'),
(50, 'Significance of Ayamel', '<iframe src="https://www.youtube.com/embed/0mxK-sB2ALM" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Ayamel Overview'),
(51, 'Connect an LMS to Ayamel', '<iframe width="640" height="390" src="https://www.youtube.com/embed/keWgrWtLZio" frameborder="0" allowfullscreen=""></iframe>', 'Ayamel Overview'),
(52, '* Ayamel in 5 Minutes', '<iframe src="https://www.youtube.com/embed/1Yr-YmtsLm4" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Ayamel Overview');
INSERT INTO `helpPage` (`id`, `title`, `contents`, `category`) VALUES
(53, 'Uploading Content from a File', '<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">First, select the My Content tab in the upper middle of\r\nthe screen.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/3e6ae951a5b03287fc993f2393898191.png" title="Image: http://arclite.byu.edu/helpimages/help53a.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">Next, click on the blue <i>Add Content</i> button. <o:p></o:p></span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/3910f0bad6eb551061c913f5a7eeb3cb.png" title="Image: http://arclite.byu.edu/helpimages/help53b.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">To upload a file saved on your computer, make sure you are on the Upload File tab.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/c9c775b7b275f1212491c994ee58d549.png" title="Image: http://arclite.byu.edu/helpimages/help53c.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">Next, hit the white&nbsp;</span><i style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;">Choose\r\nFile</i><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;"> button and upload a file, or drag and drop the file into the box that\r\nsays, “Drag and drop file here”. Note, if you are uploading a text file, you\r\ncan only upload a .txt file. Documents from Microsoft Word do not work.</span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 107%;"><img src="https://s3.amazonaws.com/ayamel/acd33121e567507a98be53897cc2d028.png" title="Image: http://arclite.byu.edu/helpimages/help53d.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">Now, make sure to fill in all the Content Information\r\nboxes and make sure it is correct. <o:p></o:p></span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">Then, click the blue&nbsp;</span><i style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">Save and Upload&nbsp;</i><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">button.</span><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><br></span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><img src="https://s3.amazonaws.com/ayamel/af3783e0012e35a9978050cb1591c566.png" title="Image: http://arclite.byu.edu/helpimages/help53e.png"><br></span></p>\r\n\r\n<p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;">Once your content is uploaded, Ayamel should\r\nautomatically open up a new window in which you can view your content.</span></p><p class="MsoNormal" style="margin-right:.5in;tab-stops:.5in"><span style="font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px;">Congratulations! You have now added content to Ayamel.</span><span style="font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;"><br></span></p>', 'Content Development for Ayamel:  Content Creation'),
(54, 'How to upload content to Ayamel (Video)', '<iframe src="https://www.youtube.com/embed/He5omX-TQ_I" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Content Creation'),
(55, 'Add words to My Word List and Export them to Quizlet', '<iframe width="1150" height="650" src="https://www.youtube.com/embed/dsXJQYdB1iM" frameborder="0" allowfullscreen=""></iframe>', 'Learning with Ayamel:  Special Features '),
(56, 'Preventing students from viewing Transcripts/Subtitles (Video)', '<iframe src="https://www.youtube.com/embed/tDNC-q0weBU" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Content Viewing'),
(57, 'Merriam Webster and ESL Content', '<iframe src="https://www.youtube.com/embed/Trajg8kVcCE" allowfullscreen="" frameborder="0" height="650" width="1150"></iframe>', 'Learning with Ayamel:  Special Features '),
(58, '1. CaptionAider Basics - Uploading and Saving (Video)', '<iframe src="https://www.youtube.com/embed/2MVfFnpYcYk" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Captions'),
(59, '3. CaptionAider - Creating Captions when you already have a transcript (Video)', 'This tutorial will teach you how to create captions when you already have a transcript of the video by using the Autocue/Autofill tool.<iframe src="https://www.youtube.com/embed/vN2S0joWIQ8" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Captions'),
(60, 'Turning on Annotations', '<p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">First, you need to make sure that your desired annotation track has been enabled. To do this, click on the configuration tab in the top right hand corner.<o:p></o:p></span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/98f56307e6d6d9eef1253c052d683434.png" title="Image: http://arclite.byu.edu/helpimages/help43a.png" style="height: auto; max-width: 100%; vertical-align: middle; border: 0px; color: rgb(51, 51, 51);"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><br></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Then, check “show text annotations” and check the caption track(s) you would like to have enabled.&nbsp;<o:p></o:p></span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/7066bc0a910e1ed5eec71ede91c57ed9.png" title="Image: http://arclite.byu.edu/helpimages/help43b.png" style="height: auto; max-width: 100%; vertical-align: middle; border: 0px; color: rgb(51, 51, 51);"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><br></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Now, make sure to scroll down and click on the blue&nbsp;<i>Save</i>&nbsp;button.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Now that you have enabled the annotation track, you need to turn it on. To do this, select the flag button next to the CC (closed captioning) button on the video player. Select the annotation track you would like to turn on.<o:p></o:p></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><img src="https://s3.amazonaws.com/ayamel/09b359b51fac9c42884f2ec80272e31b.png"><br></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Now, make sure the captions (CC) are turned on. This button is located on the player next to the volume adjustment on the video player.<o:p></o:p></span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/796996d7baf3452d040c75489e941052.png" title="Image: http://arclite.byu.edu/helpimages/help15a.png" style="color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px; height: auto; max-width: 100%; vertical-align: middle; border: 0px;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><br></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Next, play the video. When you come to an annotated word, it should appear in yellow.<o:p></o:p></span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/566634b59b83e0d4f5f2aa64759517b1.png" title="Image: http://arclite.byu.edu/helpimages/help15c.png" style="color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 16px; line-height: 17.1200008392334px; height: auto; max-width: 100%; vertical-align: middle; border: 0px;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><br></span></p><p class="MsoNormal"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Click on the annotated word and the annotation will show up to the right of the player under the Annotations tab.</span></p><p class="MsoNormal"><img src="https://s3.amazonaws.com/ayamel/24dd77e566d44fc10deede4859659456.png" title="Image: http://arclite.byu.edu/helpimages/help15d.png" style="height: auto; max-width: 100%; vertical-align: middle; border: 0px; color: rgb(51, 51, 51);"><br style="color: rgb(51, 51, 51);"><span style="color: rgb(51, 51, 51);">Note: &nbsp;Annotations can be text, image, video, or sound files.&nbsp;</span></p>', 'Content Development for Ayamel:  Content Viewing'),
(65, 'Changing your Password', '<p>Click on your profile icon at the top of the page, in between the&nbsp;<i><b>Help</b></i>&nbsp;button and search bar.</p><p>A drop-down menu will appear. Select&nbsp;<i><b>Account Settings</b></i>.</p><p>Near the bottom of the "Account Settings" page, you will see the title "Change Password."</p><p>Type your new password into the&nbsp;<i><b>New Password</b></i>&nbsp;box and&nbsp;the&nbsp;<i><b>Repeat New Password</b></i>&nbsp;box.</p><p>Hit the&nbsp;<i><b>Change Password</b></i>&nbsp;button.</p>', 'Learning with Ayamel:  Account'),
(66, 'Merging Accounts', 'NOTE:  You can only merge two accounts.<br><br>Trying to merge more than this can result in the loss of one of you accounts.<br><br>First, click on your user picture<br><br>Next, select account settings<br><br>You will see a section on the right that says, “Merge accounts”<br><br>Under this, you will see something that says, “To merge your account with another, please authenticate with one of the following methods:”<br><br>Select the method under which you have your additional account (Google+ or BYU)<br><br>Fill in the required information<br><br>After you have done this, you should see a window that says, “Alright, account merged”<br><br>You have now merged your accounts', 'Learning with Ayamel:  Account'),
(67, 'Updating Account Information', '<p>Click on your profile icon at the top of the page, in between the&nbsp;<i><b>Help&nbsp;</b></i>button and search bar.</p><p>A drop-down menu will appear. Select&nbsp;<i><b>Account Settings</b></i>.</p><p><img src="https://s3.amazonaws.com/ayamel/ee5f86c5c97a5bdb95df9d314b9e9131.png" title="Image: http://arclite.byu.edu/helpimages/help67a.png"><br></p><p>Use this page to update your account settings.</p>', 'Learning with Ayamel:  Account'),
(68, '2. CaptionAider Intermediate - Adding and Editing Cues (Video)', '<iframe src="https://www.youtube.com/embed/jcNgQijv_Z0" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Captions'),
(69, '4. CaptionAider Advanced - The Clone Tool (Video)', '<iframe src="https://www.youtube.com/embed/aTvJI-gtqUg" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Captions'),
(70, 'Uploading Content from a URL', '<p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">First, select the My Content tab in the upper middle of the screen.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><img src="https://s3.amazonaws.com/ayamel/3e6ae951a5b03287fc993f2393898191.png" title="Image: http://arclite.byu.edu/helpimages/help53a.png"><br></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Next, click on the blue&nbsp;<i>Add Content</i>&nbsp;button.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><img src="https://s3.amazonaws.com/ayamel/3910f0bad6eb551061c913f5a7eeb3cb.png" title="Image: http://arclite.byu.edu/helpimages/help53b.png" style="font-family: Arial, sans-serif; font-size: 12pt; line-height: 17.1200008392334px;"></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">To add content from&nbsp;a URL, make sure you are on the Link to URL tab.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Copy and paste the URL into the URL box.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Next, make sure all of the information is filled in and correct.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">When you have done this, click on the blue&nbsp;<i>Create</i>&nbsp;button.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;"><img src="https://s3.amazonaws.com/ayamel/1105445375681c6bdfa6b6da684897be.png" title="Image: http://arclite.byu.edu/helpimages/help70c.png"><br></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Once your content is created, Ayamel should automatically open up a new window in which you can view your content.<o:p></o:p></span></p><p class="MsoNormal" style="margin-right: 0.5in;"><span style="font-size: 12pt; line-height: 17.1200008392334px; font-family: Arial, sans-serif;">Congratulations! You have now added content to Ayamel.</span></p>', 'Content Development for Ayamel:  Content Creation'),
(71, 'How to quickly fix small subtitle mistakes (Video)', '<iframe src="https://www.youtube.com/embed/lAYkIcEwSN0" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Captions'),
(72, 'Accessing Content', '<p>There are several ways to browse content on Ayamel.</p><p>The first is to select My Content on the navigation bar at the top of the page. This will bring you to a page on which will appear&nbsp;all of the content you have uploaded.&nbsp;</p><p><img src="https://s3.amazonaws.com/ayamel/874040caa5bcc64500bb6997420f99f6.png" title="Image: http://arclite.byu.edu/helpimages/help11a.png"><br></p><p>The next way is to&nbsp;Access Ayamel''s homepage by clicking the Ayamel logo or by selection Home on the navigation bar. Content will appear under "Course Content Feed" in the middle of the page. This will show you the most recent&nbsp;content that is included in the courses you belong to.&nbsp;</p><p><img src="https://s3.amazonaws.com/ayamel/fa4e9a8d094372a542d19b0adcd21365.png" title="Image: http://arclite.byu.edu/helpimages/help11b.png"><br></p><p>The third way is to&nbsp;Access Ayamel''s homepage by clicking the Ayamel logo or by selection&nbsp;Home&nbsp;on the navigation bar. Content will appear under "My Courses" in the middle of the page. This will show you the courses you belong to. Once you click on the course, it will bring you to your course page where you will have access to course content.<br></p><p><img src="https://s3.amazonaws.com/ayamel/6e8f9edec5debb335d907d00974d70cc.png" title="Image: http://arclite.byu.edu/helpimages/help11c.png"><br></p>', 'Content Development for Ayamel:  Content Viewing'),
(73, 'Cloning Content', 'To clone (make an exact duplicate) content, open up the content and press clone.<br><img src="https://s3.amazonaws.com/ayamel/8673e04274a2b16b4e45a721752cfa1f.png" title="Image: http://arclite.byu.edu/helpimages/help73a.png"><br><br>After that is done, you will have to select <a href="http://ayamel.byu.edu/help/24" target="_blank" rel="nofollow" title="Link: http://ayamel.byu.edu/help/24">Configuration</a> in order to enable captions and annotations.<br><img title="Image: http://arclite.byu.edu/helpimages/help73b.png" src="https://s3.amazonaws.com/ayamel/4a0746b88c1ec1ab292edd55cee9fd5d.png"><br>', 'Content Development for Ayamel:  Content Creation'),
(74, 'Contributing to Ayamel', 'A big part of&nbsp;Ayamel''s design is to facilitate crowdsourcing so users can make contributions that will benefit others. In other words, as the number of&nbsp;contributors increases, so will the quantity of content that will be available to&nbsp;help&nbsp;users learn their target language.<br><br>One of the best ways to contribute to Ayamel is to find YouTube videos and add them to courses that are open and available to others for a particular language. If a YouTube video has captions, then&nbsp;copying the URL to&nbsp;<a href="http://www.downsub.com" target="_blank" rel="nofollow">DownSub.com</a> will enable contributors to&nbsp;download subtitles and then upload those to Ayamel. Even the automatic YouTube subtitles can be useful, but they usually require adjusting and editing. If they don''t have subtitles, you can create them. For help with this, check out this <a title="Link: https://ayamel.byu.edu/help/59" href="https://ayamel.byu.edu/help/59" target="_blank" rel="nofollow">help page</a>.&nbsp;<br><br>Another great way to contribute is adding subtitles to videos on Ayamel that currently do not have subtitles.<br><br>Users who have their&nbsp;own content for which they own&nbsp;the copyright can add that to open courses as well.<br><br>Users can add private content for which they have the rights, but the \r\ncourse must also be private so that only students enrolled in the course\r\n have access to the content.<br>', 'Content Development for Ayamel:  Content Creation'),
(79, 'Creating a Course and Adding Students (Video)', '<iframe width="1150" height="650" src="https://www.youtube.com/embed/LUn8nHhN94A" frameborder="0" allowfullscreen></iframe>', 'Content Development for Ayamel:  Courses'),
(80, 'Giving Students or TA''s Extra Permissions in a course (Video)', '<iframe src="https://www.youtube.com/embed/DRG-nS1nc0U" allowfullscreen="" width="1150" frameborder="0" height="650"></iframe>', 'Content Development for Ayamel:  Courses'),
(81, 'How to Batch Upload Content (Video)', '<iframe src="https://www.youtube.com/embed/gwtu74ejrDk" allowfullscreen="" width="854" frameborder="0" height="510"></iframe>\r\n\r\nThe interface for the Batch upload feature is a little different from when this video was created. Follow the instructions on the updated Batch upload page.', 'Content Development for Ayamel:  Content Creation'),
(82, 'Removing Content from a Course', 'To remove content from a course, first open up the course.<br>Then select the remove content button located to the left of the announcements.<br><img src="https://s3.amazonaws.com/ayamel/b79c7525dec713959c9da8384283a164.png"><br><br>Next, select which content you would like to remove and select remove content.<br><img src="https://s3.amazonaws.com/ayamel/52da2781d4e4c6e74012b1a33d5ed663.png" title="Image: http://arclite.byu.edu/helpimages/help82b.png"><br><br>Or open up the video you would like to remove from the course. Select course, and then remove from course.&nbsp;<br><img src="https://s3.amazonaws.com/ayamel/7c9cde34885efa69726358631b693cc8.png" title="Image: http://arclite.byu.edu/helpimages/help82c.png"><br><br>', 'Content Development for Ayamel:  Content Creation'),
(83, 'Removing Content from a Course', 'To remove content from a course, first open up the course.<br>Then select the remove content button located to the left of the announcements.<br><img src="https://s3.amazonaws.com/ayamel/b79c7525dec713959c9da8384283a164.png"><br><br>Next, select which content you would like to remove and select remove content.<br><img src="https://s3.amazonaws.com/ayamel/52da2781d4e4c6e74012b1a33d5ed663.png" title="Image: http://arclite.byu.edu/helpimages/help82b.png"><br><br>Or open up the video you would like to remove from the course. Select course, and then remove from course.&nbsp;<br><img src="https://s3.amazonaws.com/ayamel/7c9cde34885efa69726358631b693cc8.png" title="Image: http://arclite.byu.edu/helpimages/help82c.png"><br>', 'Content Development for Ayamel:  Courses'),
(84, 'What to do when YouTube captions also display on an Ayamel video', 'When watching a YouTube hosted Ayamel video, you will run into the problem of two layers of subtitles. One of these are the interactive Ayamel subtitles, but the kind underneath is from YouTube itself.<br><br><img title="Image: http://i.imgur.com/c1mInPo.gif" src="http://i.imgur.com/c1mInPo.gif"><br><br>In order to fix this you need to go to YouTube itself on turn off the subtitles from there.<br><br><img title="Image: http://i.imgur.com/CO9CIwB.gif" src="http://i.imgur.com/CO9CIwB.gif"><br>You may do this by clicking on the "YouTube" symbol in the bottom right corner of the screen and going to the YouTube video.<br>From there, click the "CC" button to turn off the subtitles.<br><br>You will now be able to see subtitles from Ayamel only.<br><br><br>', 'Learning with Ayamel:  Content Viewing'),
(85, 'How to clear cache', 'Chrome and other web browsers like to permanently save little pieces of websites so that you don''t have to download the same information over and over again. Unfortunately this can mean that subtitles you are working on won''t appear to be saved, as your web browser is loading old information. Or that fixes we make won''t appear at first.<br><br>To fix this, you may need to clear your cache (little pieces of websites) that your browser has saved. Different browsers clear their caches differently.<br><br><b>On MacOS:</b><br>While in <b>Firefox</b> or <b>Chrome</b>, press the buttons&nbsp;<i>Command+Shift+Delete</i><br><br>For <b>Chrome</b>, a page like this will pop up:<br><img src="https://s3.amazonaws.com/ayamel/3adf28e80c35a70ba9b4b3cee86a3f98.png" title="Image: https://s3.amazonaws.com/ayamel/3adf28e80c35a70ba9b4b3cee86a3f98.png"><br>Be sure to select: "Obliterate the following from the beginning of time" and check "cached images and files." Then press "clear."<br><br><br><br><br>For <b>Firefox</b>, a page like this will pop up:<br><br><img src="https://s3.amazonaws.com/ayamel/50cdc02275cc75af56d925f71175462d.png" title="Image: https://s3.amazonaws.com/ayamel/50cdc02275cc75af56d925f71175462d.png"><br>Be sure to check "Cache" and the press "clear."<br><br>For <b>Safari</b>, <a href="http://osxdaily.com/2016/01/17/empty-cache-safari-mac-os-x/" target="_blank" rel="nofollow" title="Link: http://osxdaily.com/2016/01/17/empty-cache-safari-mac-os-x/">please consult this tutorial</a>.<br><br>Or press <i>Shift</i>+<i>The Refresh button at the end of the url bar&nbsp;</i>to clear the cache on a single page.<br>------<br><br><b>On Windows:</b><br>While in the browser, press&nbsp;<i>Ctrl+Shift+Delete</i><br><br>This will work on <b>Firefox</b> and <b>Chrome </b>and should provide similar screens like the ones&nbsp;above in MacOS.<br><br><br>------<br><br>Once you have cleared your cache, check back on your subtitles or the Ayamel player to see the new changes.<br><br>', 'Other');
INSERT INTO `homePageContent` (`id`, `title`, `text`, `link`, `linkText`, `background`, `active`) VALUES
(2, 'Pardon our dust', 'We''re working hard to provide language learning magic, so there may be some things don''t work well, or at all. Please be patient. You will be rewarded as awesomeness occurs.', '', '', '/assets/images/home/construction.jpg', 0),
(5, 'Help Make Ayamel Even More Awesome!', 'Ayamel is a crowdsourcing effort. We need your help to add more content in more languages to Ayamel.', 'https://ayamel.byu.edu/help/74', 'Find out how!', 'https://s3.amazonaws.com/ayamel/d9fb1f31da9c263c0e058a83e2a73260.png', 0),
(9, 'Enrich your studies', 'Use Ayamel to increase your language skills.', '', '', 'https://ayamel.byu.edu/assets/images/home/byu-campus.jpg', 0),
(13, 'Pardon the Dust!', 'Apparently some of the dust got into the workings of our dictionary lookup server, so it is down temporarily. We are working on it to get it back up as soon as possible!', '', '', 'https://ayamel.byu.edu/assets/images/home/construction.jpg', 0),
(17, 'Webinar on Ayamel', 'The ACTFL Distance Learning SIG will sponsor a Webinar presented by Dr. Michael Bush, Brigham Young University, on Ayamel on Wednesday, January 27, 2016 at 2:00 pm MST (4:00 pm EST).', 'https://byu.zoom.us/webinar/register/9cf2f8e64425e2b27c24e00bf0acd2b8', 'Click to Register', 'https://s3.amazonaws.com/ayamel/bdd5b5fec73f756c530c1267330ba74d.png', 0),
(19, 'Ayamel Player is Down', 'Videos hosted on Brightcove are currently not viewable. (The Safari browser for Mac sometimes works, but is unreliable). We''ll get a fix for this as soon as possible. Please notify your teachers about this delay and/or contact us.', 'mailto:arclitelab@gmail.com', 'Contact Us', 'https://s3.amazonaws.com/ayamel/b1d064cd2ba93a6c5ade67f2566d3edb.png', 0),
(22, 'Ayamel Player is (Mostly) Up', 'Videos hosted on Brightcove are now viewable again! If your video size is small, you may need to resize your browser to fix that. There may be other bugs, and you may need to clear your cache. Thank you for your patience.', 'https://ayamel.byu.edu/help/85', 'How to clear your cache', 'https://s3.amazonaws.com/ayamel/efeffc10cc20262dad50d7153fd68cca.jpg', 1);
