INSERT INTO `play_evolutions` (`id`, `hash`, `applied_at`, `apply_script`, `revert_script`, `state`, `last_problem`) VALUES
(1, '8ef039a9a5170d7b37a3c04e77541d9aa68e5b9a', '2014-02-07 19:39:03', 'create table content (\nid             bigint not null auto_increment,\nname           varchar(255) not null,\ncontentType    varchar(255) not null,\nthumbnail      varchar(255) not null,\nresourceId     varchar(255) not null,\ndateAdded      varchar(255) not null,\nprimary key(id)\n);\n\ncreate table contentListing (\nid             bigint not null auto_increment,\ncourseId       bigint not null,\ncontentId      bigint not null,\nprimary key(id)\n);\n\ncreate table contentOwnership (\nid             bigint not null auto_increment,\nuserId         bigint not null,\ncontentId      bigint not null,\nprimary key(id)\n);\n\ncreate table course (\nid             bigint not null auto_increment,\nname           varchar(255) not null,\nstartDate      varchar(255) not null,\nendDate        varchar(255) not null,\nlmsKey         varchar(255) not null,\nprimary key(id)\n);\n\ncreate table courseMembership (\nid             bigint not null auto_increment,\nuserId         bigint not null,\ncourseId       bigint not null,\nteacher        boolean not null,\nprimary key(id)\n);\n\ncreate table userAccount (\nid             bigint not null auto_increment,\nauthId         varchar(255) not null,\nauthScheme     varchar(255) not null,\nusername       varchar(255) not null,\nname           varchar(255) null,\nemail          varchar(255) null,\nrole           int not null,\nprimary key(id)\n);', 'drop table if exists content;\ndrop table if exists contentListing;\ndrop table if exists contentOwnership;\ndrop table if exists course;\ndrop table if exists courseMembership;\ndrop table if exists userAccount;', 'applied', ''),
(2, '1f2c39fa3a343e2f2c517bf3c87440b7bab6f064', '2014-02-07 19:39:03', 'alter table userAccount add column picture varchar(511) null;\n\ncreate table announcement (\nid             bigint not null auto_increment,\ncourseId       bigint not null,\nuserId         bigint not null,\ntimeMade       varchar(255) not null,\ncontent        varchar(255) not null,\nprimary key(id)\n);', 'alter table userAccount drop column picture;\ndrop table if exists announcement;', 'applied', ''),
(3, 'f3cb06664ce0592bb655effba4be8d2035f369e7', '2014-02-07 19:39:03', 'alter table content\nadd column visibility int not null default 2,\nadd column shareability int not null default 3;', 'alter table content drop column visibility, drop column shareability;', 'applied', ''),
(4, '18d50baeacf6828ff16d553f3040c1c7cacb3545', '2014-02-07 19:39:03', 'create table teacherRequest (\nid             bigint not null auto_increment,\nuserId         bigint not null,\nreason         varchar(2048) not null,\nprimary key(id)\n);\n\ncreate table notification (\nid             bigint not null auto_increment,\nuserId         bigint not null,\nmessage        varchar(512) not null,\ndateSent       varchar(255) not null,\nmessageRead    boolean not null,\nprimary key(id)\n);\n\nalter table content add column settings longtext not null;', 'drop table if exists teacherRequest;\ndrop table if exists notification;\nalter table content drop column settings;', 'applied', ''),
(5, 'c883e4d6f77695fa5538320d3df09739c93c8301', '2014-02-07 19:39:03', 'create table accountLink (\nid                bigint not null auto_increment,\nuserIds           longtext not null,\nprimaryAccount    bigint not null,\nprimary key(id)\n);\n\nalter table userAccount add column accountLinkId bigint not null default -1;', 'drop table if exists accountLink;\nalter table userAccount drop column accountLinkId;', 'applied', ''),
(6, '2a2fc82997fd83b562b2c2358685dbddca6fdf77', '2014-02-07 19:39:03', 'create table addCourseRequest (\nid             bigint not null auto_increment,\nuserId         bigint not null,\ncourseId       bigint not null,\nmessage        varchar(255) not null,\nprimary key(id)\n);', 'drop table if exists addCourseRequest;', 'applied', ''),
(7, '0d25ff9c3ea8289aca41d624e6f1025fdf8cbe15', '2014-02-07 19:39:03', 'alter table content add column authKey varchar(255) not null;', 'alter table content drop column authKey;', 'applied', ''),
(8, '9fc2d64acae83d78b4a51212a650cec6a05fe928', '2014-02-07 19:39:03', 'create table activity (\nid                bigint not null auto_increment,\nactor             bigint not null,\nverb              varchar(255) not null,\npageCategory      varchar(255) not null,\npageAction        varchar(255) not null,\npageId            bigint not null,\ngeneratorType     varchar(255) not null,\ngeneratorId       varchar(255) not null,\ngeneratorItemRef  varchar(255) not null,\nobjectType        varchar(255) not null,\nobjectId          varchar(255) not null,\nobjectItemRef     varchar(255) not null,\npublished         varchar(255) not null,\nprimary key(id)\n);', 'drop table if exists activity;', 'applied', ''),
(9, 'ad8302e5a725ca53350e818df9c46c82657fdda4', '2014-02-07 19:39:03', 'create table homePageContent (\nid            bigint not null auto_increment,\ntitle         varchar(255) not null,\ntext          varchar(255) not null,\nlink          varchar(255) not null,\nlinkText      varchar(255) not null,\nbackground    varchar(255) not null,\nactive        boolean not null,\nprimary key(id)\n);', 'drop table if exists homePageContent;', 'applied', ''),
