(12, '9fa985a23137266a688423d415ca43100f4e4bda', '2014-02-07 19:39:03', 'create table feedback (\nid             bigint not null auto_increment,\nuserId         bigint not null,\ncategory       varchar(255) not null,\ndescription    longtext not null,\nsubmitted      varchar(255) not null,\nprimary key(id)\n);', 'drop table if exists feedback;', 'applied', ''),
(13, '21dd35496f0ea06489e1237f833c189df90291b4', '2014-02-07 19:39:03', 'create table setting (\nid             bigint not null auto_increment,\nname           varchar(255) not null,\nsettingValue   longtext not null,\nprimary key(id)\n);', 'drop table if exists setting;', 'applied', ''),
(14, '1dd590787fa32fedde36b49430bcd011831f4479', '2014-02-07 19:39:03', 'alter table userAccount\nadd column created varchar(255) not null default "2013-01-01T12:00:00.000-06:00",\nadd column lastLogin varchar(255) not null default "2013-01-01T12:00:00.000-06:00";', 'alter table userAccount drop column created, drop column lastLogin;', 'applied', ''),
