(19, '34626bb1d35bcb8148d40605d3892e73949fe9c8', '2014-11-06 02:22:30', 'create table sitePermissions (\nid                bigint not null auto_increment,\nuserId            bigint not null,\npermission        varchar(255) not null,\nprimary key(id)\n);\n\ncreate table coursePermissions (\nid                bigint not null auto_increment,\ncourseId          bigint not null,\nuserId            bigint not null,\npermission        varchar(255) not null,\nprimary key(id)\n);\n\ncreate table sitePermissionRequest (\nid             bigint not null auto_increment,\nuserId         bigint not null,\npermission     varchar(255) not null,\nreason         varchar(2048) not null,\nprimary key(id)\n);\n\ndrop table if exists teacherRequest;', 'drop table if exists sitePermissions;\ndrop table if exists coursePermissions;\ndrop table if exists sitePermissionRequest;\n\ncreate table teacherRequest (\nid             bigint not null auto_increment,\nuserId         bigint not null,\nreason         varchar(2048) not null,\nprimary key(id)\n);', 'applied', ''),
(20, 'e9cbd055312661662a9b98544711df58e0924124', '2014-11-06 02:22:30', 'alter table content drop column settings;\n\ncreate table contentSetting (\nid                bigint not null auto_increment,\ncontentId         bigint not null,\nsetting           varchar(255) not null,\nargument          text not null,\nprimary key(id)\n);', 'alter table content add column settings longtext not null;\n\ndrop table if exists contentSetting;', 'applied', ''),
