(22, 'bd6222779b8d8779b2cdfe7f67f1a16bb5cbe880', '2015-02-02 19:42:47', 'alter table wordList add column srcLang varchar(8) not null default "eng";\nalter table wordList add column destLang varchar(8) not null default "eng";\nupdate wordList set srcLang = language;\nalter table wordList drop language;', 'alter table wordList add column language varchar(8) not null default "eng";\nupdate wordList set language = srcLang;\nalter table wordList drop srcLang;\nalter table wordList drop destLang;', 'applied', ''),
