(948, 'Ne m''en veuillez pas, je suis obligée de filer.', 1489, 'fra', 'eng'),
(949, 'Cela me ferais plaisir que nous puissions déjeuner tous les trois un de ces jours.', 1489, 'fra', 'eng'),
(950, 'd''apporter mon aide à un directeur aussi compréhensif.', 1489, 'fra', 'eng'),
(951, 'Celui là c''est un cas à part.', 1489, 'fra', 'eng'),
(952, 'Et dans les yeux de Morhange, qui suivaient si bien ma mesure,', 1489, 'fra', 'eng'),
(953, 'Je lisais tout à coup beaucoup de choses : De la fierté, la joie d''être pardonné', 1489, 'fra', 'eng'),
(954, 'mais aussi, c''était bien nouveau pour lui, comme de la reconnaissance.', 1489, 'fra', 'eng'),
(955, 'Ce beau temps les rend tristes.', 1489, 'fra', 'eng'),
(956, 'Personne ne savait où était ta planque.', 1489, 'fra', 'eng'),
(957, 'Une mongolfière.', 1489, 'fra', 'eng'),
(958, 'Nous ferons l''enquête après demain, dès mon retour.', 1489, 'fra', 'eng'),
(959, 'Mais en vérité, il va surtout faire des ronds de jambe pour son avancement et sa décoration.', 1489, 'fra', 'eng'),
(960, 'Ah ! Malin comme il est ? Il va présenter un bilan idyllique de son établissement.', 1489, 'fra', 'eng'),
(961, 'L''oiseau est dans le nid, M. Rachin', 1489, 'fra', 'eng'),
(962, 'Le feu avait pris sous les toits.', 1489, 'fra', 'eng'),
(963, 'Les flammes dévoreraient les dortoirs, là où les enfants avaient été vus pour la dernière fois.', 1489, 'fra', 'eng'),
(964, 'Soixante gamins disparus, piégés comme des rats.', 1489, 'fra', 'eng'),
(965, 'Après le déjeuner, je les ai fait passer par la porte du potager.', 1489, 'fra', 'eng'),
(966, 'Faire un jeu de pistes. Ils étaient contents.', 1489, 'fra', 'eng'),
(967, 'Inutile de vous dire, Monsieur Maxence, que j''éprouve une déception définitive à votre égard.', 1489, 'fra', 'eng'),
(968, 'Monsieur Maxence n''a pas cessé un instant de vouloir m''en dissuader.', 1489, 'fra', 'eng'),
(969, 'C''est ce qu''on appelle manquer de conviction.', 1489, 'fra', 'eng'),
(970, 'D''un autre côté, on peut aussi considérer que nous avons sauvé la vie de ces enfants.', 1489, 'fra', 'eng'),
(971, 'Oui, enfin si vous n''aviez pas laisser l''établissement sans surveillance, il n''y aurait pas eu d''incendie !', 1489, 'fra', 'eng'),
(972, 'vous subirez seulement une mise à pied.', 1489, 'fra', 'eng'),
(973, 'Quant à vous, monsieur Mathieu, vous êtes renvoyé', 1489, 'fra', 'eng'),
(974, 'pour avoir failli aux règlements.', 1489, 'fra', 'eng'),
(975, 'Puisque c''est comme ça, mettez-moi à la porte aussi !', 1489, 'fra', 'eng'),
(976, 'C''est gentil de votre part monsieur Maxence, mais je crois qu''on a encore besoin de vous ici.', 1489, 'fra', 'eng'),
(977, 'Pensez aux gosses, puisque ce monsieur n''y pense jamais.', 1489, 'fra', 'eng'),
(978, 'J''ai préparé votre compte, tenez.', 1489, 'fra', 'eng'),
(979, 'Vous partez immédiatement par l''autocar de 18 heures.', 1489, 'fra', 'eng'),
(980, '- Je vous défends de revoir même un instant vos anciens élèves. - Comment ça ?', 1489, 'fra', 'eng'),
(981, 'Monsieur Maxence, vous y veillerez. Allez, sortez.', 1489, 'fra', 'eng'),
(982, 'Euh ! Monsieur le directeur, avant de nous séparer, permettez-moi de vous dire ce que je pense de vous.', 1489, 'fra', 'eng'),
(983, '- Vous êtes un homme incompétent, profondément méchant. - Et eux ?', 1489, 'fra', 'eng'),
(984, 'Je n''ai jamais eu la vocation de devenir éducateur.', 1489, 'fra', 'eng'),
(985, 'Et ne me dites pas que vous rêviez de vous enterrer ici dans le trou du cul du monde.', 1489, 'fra', 'eng'),
(986, 'Mais allez-y vous, prenez votre bâton de pèlerin. Montez à Paris !', 1489, 'fra', 'eng'),
(987, 'Vous n''êtes qu''un musicien raté, un pion.', 1489, 'fra', 'eng'),
(988, 'J''avais espéré que des élèves forceraient la consigne pour me faire leurs adieux, mais rien.', 1489, 'fra', 'eng'),
(989, 'La sagesse de ces enfants ressemblait bien à l''indifférence.', 1489, 'fra', 'eng'),
(990, 'Silence-là ! Faites-les taire !', 1489, 'fra', 'eng'),
(991, 'À cet instant, je ressenti une bouffée de joie et d''optimisme.', 1489, 'fra', 'eng'),
(992, 'J''aurais voulu le crier au monde entier.', 1489, 'fra', 'eng'),
(993, 'Le grand artiste allait vite retrouver sa condition d''homme.', 1489, 'fra', 'eng'),
(994, 'Je m''appelle Clément Mathieu, musicien raté, pion au chômage.', 1489, 'fra', 'eng'),
(995, 'Mais moi, je peux te la raconter.', 1489, 'fra', 'eng'),
(996, 'mon enfance me sautait à la gorge.', 1489, 'fra', 'eng'),
(997, 'Nous sommes partis à Lyon, où je fut reçu au conservatoire.', 1489, 'fra', 'eng'),
(998, 'Clément Mathieu a continué à donner des cours de musique, jusqu''à la fin de sa vie.', 1489, 'fra', 'eng'),
(999, 'Sans chercher à se faire connaître.', 1489, 'fra', 'eng'),
(1000, 'Vous pouvez m''amener avec vous ?', 1489, 'fra', 'eng'),
(1001, 'Allez, repars !', 1489, 'fra', 'eng'),
